    str.gsub!(/\\diamondsuit((\{\})|\s|$)/, "♦")
    str.gsub!(/\\Diamond((\{\})|\s|$)/, "⋄")
    str.gsub!(/\\loz((\{\})|\s|$)/, "◊")
  end
end # module Orgmode
